import { createGlobalStyle } from 'styled-components';
 
export const GlobalStyle = createGlobalStyle`
    @font-face {
        font-family: 'duo-family';
        src: url('../asssets/fonts/AppleSDGothicNeoEB.ttf');
    }
`;
 
export default GlobalStyle;
